  false,\n\t\"url\": null,\n\t\"notes\": \"The evaluation employs administrative data
  from 12 states, covering approximately 160,000 WIA participants and nearly 3 million
  comparison group members. Focusing on participants who entered WIA programs between
  July 2003 and June 2005, the evaluation considers the impact for all those in the
  program, the impact for those receiving only Core or Intensive Services, and the
  incremental impact of Training Services. This dataset contains all of the information
  used to conduct the non-experimental evaluation estimates for thernrnWIA Client
  Treatment Group andrnThe Unemployment Insurance and Employment Service Client comparison
  group.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
